import React from "react"
import './App.css';
import { startSnakeGame } from './SnakeApp.js';


function startGame () {
	startSnakeGame();
}

function Snake(props) {
  return (
    <div className="container-fluid">
      <h1>Mutha fuckin snakes on a plane!!</h1>
      <div id="game-space"></div>
      <p>score: <span id="score"></span></p>
      <div id="start-snake">START TEST</div>
      <div className="row">
        <button className="btn"
        			  onClick={startGame}>
        	Start Game
        </button>

	    </div>
    </div>
  )
}

export default Snake;
